'use client';

import { useState } from 'react';
import classNames from 'classnames';

import styles from './Bandwidth.module.css';

/**
 * The Pretendo mascot: it speaks! For the non-speaking svg, see <VanillaBandwidth />
 *
 * @param {array} lines - The lines for Bandwidth to speak
 * @param {number} size - Sets the height of Bnadwidth. Defaults to 192.
 * @param {number} alignBubble - Can be 'left', 'center', or 'right'. The margin to align the bubble to.
 * @param {boolean} alwaysShowBubble - Always show the text. Defaults to false (only shows on click)
 * @param {string} className - Classname to apply to the component.
 * @param {string} style - Custom styles to apply to the component.
 *
 * @example
 * <Bandwidth lines={['what\'s the deal with airline food??', 'I will eat your cables.']} />
 *
 */

export default function Bandwidth(ctx) {
	const { lines = [], size = 192, alwaysShowBubble = false, alignBubble = 'center', className, style } = ctx;

	const [lineIndex, setLineIndex] = useState(-1 + alwaysShowBubble);
	const [jump, setJump] = useState(false || alwaysShowBubble);

	const active = lineIndex > -1;

	const updateLine = () => {
		setJump(true);
		if (lineIndex === lines.length - 1) {
			setLineIndex(0);
		} else {
			setLineIndex(lineIndex + 1);
		}
	};

	if (!Array.isArray(lines) || !lines.length) {
		return <VanillaBandwidth className={className} />;
	} else {
		return (
			<div className={classNames(styles.wrapper, { [styles.active]: active }, className)} style={style}>
				{active && (
					<div className={classNames(styles.bubble, styles[alignBubble])}>
						<p>{lines[lineIndex]}</p>
					</div>
				)}
				<VanillaBandwidth
					size={size}
					onClick={updateLine}
					className={classNames(styles.bandwidth, { [styles.jump]: jump })}
					onAnimationEnd={() => setJump(false)}
				/>
			</div>
		);
	}
}

